script: |
  super -f text -I q11482.spq | sort > q11482.out

inputs:
  - name: q11482.spq
    data: |
      SELECT 91 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT IN ( col1, 54, + col0 + - ( col0 ) * - + col1, - 32, + + col1 );
  - name: tab1

outputs:
  - name: q11482.out
    data: |
      91
      91
      91
